import { createContext } from "react";

export type UserType = {
  id: string | undefined;
  name: string | undefined;
  // img: string | undefined | null
  // activitiesCount: number | undefined
};

type ContextType = {
  user: UserType;
  logout: any;
};

const UserContext = createContext<ContextType>({
  user: {
    id: "0",
    name: "",
    // img: '',
    // activitiesCount: 0,
  },
  logout: null,
});

export default UserContext;
